import {useDispatch, useSelector} from "react-redux";
import {useEffect} from "react";
import {fetchAllUsers} from "../../store/user-actions";
import {User, UserLevel} from "../../types/User";
import AdminList from "./AdminList";

const AdminBoard = () => {
  const user = useSelector((state: any) => {console.log(state.user); return state.user.user});
  const dispatch = useDispatch();

  useEffect(() => {
    if (user && user.userLevel === UserLevel.ADMIN) {
      dispatch(fetchAllUsers(user));
    }
  }, [dispatch, user]);

  return (
    <div>
      <div>Welcome to Admin Board</div>
      {/*{user?.user.users && <AdminList users={user.users} />}*/}
      {/*{(!user || !user.users) && <div>Fetching list of users...</div>}*/}
    </div>
  )

}

export default AdminBoard;
